import React, { useEffect, useState } from "react";

const Project = () => {
  const [project, setProject] = useState([]);
  useEffect(() => {
    fetch("data.json")
      .then((res) => res.json())
      .then((data) => console.log(data));
  }, []);
  return (
    <div>
      <h1>Project</h1>
    </div>
  );
};

export default Project;
